[{"location":"","page":"Home","title":"Home","text":"CurrentModule = AnalyticComb","category":"page"},{"location":"#AnalyticComb","page":"Home","title":"AnalyticComb","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for AnalyticComb.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [AnalyticComb]","category":"page"},{"location":"#AnalyticComb.SEQ-Tuple{Any}","page":"Home","title":"AnalyticComb.SEQ","text":"SEQ(z)\n\nSequence operator\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.W_coeff-Tuple{Any}","page":"Home","title":"AnalyticComb.W_coeff","text":"W_coeff(r;n_tot=200)\n\nTaylor series coefficient from generating function for binary words that never have more than r consecutive identical letters. \n\nThe number of binary words that never have more than r consecutive identical letters is found to be (set α = β = r). n_tot defaults to 200, according to the example in Flajolet & Sedgewick pag. 52\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.p_binary_words_runl-Tuple{Any, Any}","page":"Home","title":"AnalyticComb.p_binary_words_runl","text":"p_binary_word_runs(k,n)\n\nReturns probablity associatied with k-lenght run in a sequence of size n. \n\nRefer to the example in Flajolet & Sedgewick pag. 52.  \n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.partitions-Tuple{Any}","page":"Home","title":"AnalyticComb.partitions","text":"partitions(n)\n\nAsymptotics for partition of integers by Hardy and Ramanujan, later improved by Rademache\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.primes_composition-Tuple{Any}","page":"Home","title":"AnalyticComb.primes_composition","text":"primes_composition(n)\n\nAsymptotics for composition of primes.\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.restricted_sum_comp-Tuple{Any, Any}","page":"Home","title":"AnalyticComb.restricted_sum_comp","text":"restricted_sum_comp(n,r)\n\nNumber of compositions of n with components in the set {1,2,..,r}. \n\nr = 2 yields Fibonnaci numbers and r>2 yields generalized Fibonacci numbers.\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.restricted_sum_comp_gf-Tuple{Any}","page":"Home","title":"AnalyticComb.restricted_sum_comp_gf","text":"restricted_sum_comp_gf(r)\n\nGenerating function for compositions with restricted summand.\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.restricted_sum_part-Tuple{Any, Any}","page":"Home","title":"AnalyticComb.restricted_sum_part","text":"restricted_sum_part(n,r)\n\nNumber of partitions with components in r with restricted summand n.\n\nn must be an integer and r must be a set of integers, like in r = [1,5,10,25] , n = 99.\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.restricted_sum_part_gf-Tuple{Any}","page":"Home","title":"AnalyticComb.restricted_sum_part_gf","text":"restricted_sum_part_gf(r)\n\nGenerating function for partition with restricted summand.\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.stirling_catalan-Tuple{Any}","page":"Home","title":"AnalyticComb.stirling_catalan","text":"stirling_catalan(n)\n\nStirling approximation for n_th Catalan number .\n\n\n\n\n\n","category":"method"},{"location":"#AnalyticComb.stirling_factorial-Tuple{Any}","page":"Home","title":"AnalyticComb.stirling_factorial","text":"stirling_factorial(n)\n\nStirling approximation for n! as (n/exp(1))^nsqrt(2pi*n).\n\n\n\n\n\n","category":"method"}]
